import React, { Component } from 'react';
import Layout from '../components/Layout';

class IndexPage extends Component {
  state = {
    user: null
  }

  render() {
    return (
      <Layout>
      <div>
        <p>Hello!</p>
      </div>
    </Layout>
    );
  }
}

export default IndexPage;
